#include <bits/stdc++.h>
using namespace std;

#define fast_io ios_base::sync_with_stdio(false); cin.tie(NULL); cout.tie(NULL);
typedef long long ll;


    bool check(string &s, string &t)
    {
        if (s == "" && t != "")
            return false;
        vector<int> mp(256, 0);
        for (char i : t)
            mp[i - 'A']++;
        for (char i : s)
            mp[i - 'A']--;
        int a = *max_element(mp.begin(), mp.end());
        if (a > 0)
            return false;
        return true;
    }


    string minWindow(string &s, string &t)
    {
        if (check(s, t) == false)
        {
            return "";
        }
        int l = 0, r = 0, cnt = 0;
        string ans = s, answer = s;
        vector<int> mp(256, 0);
        for (char i : t)
            mp[i - 'A']++;

        while (r < s.size())
        {
            // cout << s.substr(l,(r-l+1)) << endl;

            if (mp[s[r] - 'A'] > 0)
            {
                cnt++;
            }
            mp[s[r] - 'A']--;

            while (cnt == t.size())
            {
                ans = s.substr(l, (r - l + 1));

                mp[s[l] - 'A']++;

                if (mp[s[l] - 'A'] > 0)
                    cnt--;

                l++;
            }
            if (ans.size() < answer.size())
            {
                answer = ans;
            }
            r++;
        }
        if (answer.size() > s.size())
            return "";
        return answer;
    }


